  \ a schedule for the band to go to listen to. I'm worried about sunburn here. All\
  \ live performances are held outdoors, but Aizu Nyan has a constitution that makes\
  \ it easy to get sunburned, so if you are exposed to too much ultraviolet rays outdoors\
  \ for a long time, you will get sunburned immediately. I plan to avoid UV rays as\
  \ much as possible by evacuating indoors while there is no live performance, but\
  \ during the live performance, it will inevitably hit the sun. Therefore, Aizu Nyan\
  \ thought about taking measures against ultraviolet rays by applying sunscreen.\n\
  \nproblem\n\nIf you apply sunscreen, you can get the effect for T minutes from the\
  \ time you apply it. Sunscreen can only be applied once, so I want to use it effectively.\
  \ Aizu Nyan is outdoors from the start time to the end time of the live, and is\
  \ indoors at other times. You'll be given a live schedule that Aizu Nyan will listen\
  \ to, so find the maximum amount of time you can get the sunscreen effect while\
  \ you're outdoors.\n\nInput format\n\nThe input can be given in the following format.\n\
  \n\nT\nN\ns_1 t_1\n...\ns_N t_N\n\n\nThe first line is given an integer T that represents\
  \ the time it takes to get the sunscreen effect. The second line is given an integer\
  \ N that represents the number of live concerts Aizu Nyan listens to. The following\
  \ N lines are given the integer s_i, which represents the start time of the live\
  \ that Aizu Nyan listens to thi, and the integer t_i, which represents the end time,\
  \ separated by spaces.\n\nConstraint\n\n* 1 \u2264 T \u2264 10 ^ {15}\n* 1 \u2264\
  \ N \u2264 10 ^ 5\n* 0 \u2264 s_i <t_i \u2264 10 ^ {15} (1 \u2264 i \u2264 N)\n\
  * The start time of the (i + 1) th live is the same as or later than the end time\
  \ of the i-th live. That is, t_i \u2264 s_ {i + 1} (1 \u2264 i <N)\n\n\n\noutput\n\
  \nPrint one line for the maximum amount of time you can get the sunscreen effect\
  \ while you're outdoors.\n\nInput example 1\n\n\n20\n1\n0 10\n\n\nOutput example\
  \ 1\n\n\nTen\n\nInput example 2\n\n\n20\n1\n0 100\n\n\nOutput example 2\n\n\n20\n\
  \nInput example 3\n\n\n9\n3\n1 5\n9 11\n13 20\n\n\nOutput example 3\n\n\n7\n\nInput\
