  C E D# F G A\nC E F G\n6 4\nC E D# F G A\nC D# F G\n3 6\nC D D\nD# B D B D# C#\n\
  8 8\nC B B B B B F F\nC B B B B B B B\n\n\nOutput\n\nYes\nNo\nYes\nNo\nA: ```dic\
