  G\":7,\n       \"G#\":8, \"A\":9, \"A#\":10, \"B\":11}\nt = int(input())\nfor _\
  \ in range(t):\n  n, m = map(int, input().split())\n  t_lst = [-100] + list(map(lambda\
  \ x:dic[x],input().split()))\n  s_lst = list(map(lambda x:dic[x],input().split()))\n\
  \  s_lst.reverse()\n  \n  def search(stack):\n    t_index, s_index = stack.pop()\n\
  \    if s_index == m: return t_index == 0\n    if t_index <= 0 or t_index > n: return\
  \ False\n    base = t_lst[t_index]\n    proc = s_lst[s_index]\n    diff = (proc\
  \ - base) % 12\n    if diff == 1  :stack.append((t_index - 2, s_index + 1))\n  \
  \  if diff == 0  :stack.append((t_index - 1, s_index + 1))\n    if diff == 11 :stack.append((t_index\
  \ + 1, s_index + 1))\n    return False\n  stack = [(n, 0), (n - 1, 0)]\n  while\
